import React from 'react';
import { Link } from 'react-router-dom';
import { Nav , Col} from 'react-bootstrap';
const HeaderNavigation = () => {
    return (
        <div className="headerNavigation">
           <Nav>
            <Nav.Item>
                    <Nav.Link to="/accueil">Accueil</Nav.Link>
                      </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-1">Voiture d'Occasion</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2"> Voiture de Luxe </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2"> Pi√®ces de Vehicules </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2"> Admin </Nav.Link>
                    </Nav.Item>
            </Nav>
        </div>
    );
};

export default HeaderNavigation;
